INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (199,'043','한소리 포용에 글수가 다 넘라는 것입니다. 먼저는 곤하고 뒤에는 길하니 글쓴이의 운수를 통하면 안되겠습니다. 한 번은 기쁨이 있을꺼 한 번은 슬픈 눈물을 뿌리니 구설을 조심해야겠습니다. 염해는 마음을 한 곳에 정하지 못하고 움직이는 운이므로 비록 수고한 노고가 있으나 그 화답할 확실한 공로가 없겠습니다. 그러나 구하는 것을 성취할 운에 들었으니 노력하면 이루어지겠습니다. 만일 후의하지 않으면 도리어 복일이 재앙으로 바뀌므로 한 번은 형되이 놀런 일이 생길 것입니다. 또한 한 해 내내 후사를 조심해야 하겠고 물고기 거칠 가운데 배를 타고 떠나니 흉한 것이 많고 길한 것은 적겠습니다. 그러나 연말에는 재앙이 사라지고 고대하던 재물이 쌓이게 되니 고통의 순간들을 이겨내면 마치 형통함을 보는 운세입니다.','봄날 새싹이 서리를 맞았으니 성장하기 어려운 것입니다. 집에 있어 옛것을 지키면 길하고 나가거나 동하여 새것을 꾀하면 흉가 있습니다. 실행함이 불리하니 조심하여 옛것을 지키고 신중해야 합니다.','경거망동하지 마십시오. 후사이 두렵습니다. 다른 사람의 말을 쉽게 믿고 따르다간 반드시 그로 인해 해를 입게 됩니다. 두 사람의 마음이 각각 다른데 어찌 일을 성사할 것이며 성사하더라도 흐지부지 않겠습니까. 조심하고 조심할 일입니다.','내화를 면하기 어려우니 집안일과 자신을 잘 돌봐야 합니다. 새로 부딪치고 서로 맞지 않으니 슬픈 일이 생기고 눈물을 뿌리게 되겠습니다. 만약 다른 사람과 서로 상대하지 않으면 반드시 실패가 있을 것이니 실패가 다른 사람과 꾀하는 것을 주의하십시오.','마음속에 말못할 무로움이 있고 일마다 흐지부함이 있으니 무렵겠습니다. 흉함이 많고 길함이 적으니 이 운을 어찌 하겠습니까. 그대의 꽃다운 인연은 이성이 가장 길하니 이성 사귀는데 유의하면 가히 얼어을 면하게 되겠습니다.','안정하면 길하고 집을 나가 일을 꾀하면 불리합니다. 좋은 운이 늘거야 돌아왔으니 좋은 기회를 놓치지 말고 과감하게 도전하십시오 몸도 재물도 융성해지나 신수는 좋아지나 부호에게 진심이 생겼으니 이를 어찌하겠습니까. 따라서 길흉이 반반입니다.','만약 장애가 아니면 구설수를 면하기 어렵습니다. 시비를 가까이 하지 마십시오. 관재가 불리합니다. 동남방에는 실행함이 불리하니 시작하는 일과 일을 바침에 신축을 기하지 않으면 후회를 면하기 어렵습니다. 동쪽과 남쪽으로 나아갈 일이 있다면 주의하십시오.','후사를 조심해야 합니다. 가을비가 내리는 봄바람에 푸른잎이 더욱 찬찬해 지듯 새 운이 역리기 시작하겠습니다. 다행하게도 옛 인연을 만나게 된다면 이익이 나의 집으로 들어와 도움을 주게 되겠습니다.','집을 나서서 몰리 실행하게 된다면 그 화가 적지 않겠으며 하던 일을 그만두고 새 일을 도모한다면 불리하겠습니다. 서쪽과 북쪽으로 실행하면 불리하니 새 일을 도모하고자 할 때 특히 주의하십시오. 신수가 불리할 때는 모든 일을 조심하고 기다림이 좋겠습니다.','9월과 10월에는 재수가 대길하겠습니다. 드디어 얼어이 가고 기쁨의 문이 열립니다. 그러나 다른 경영을 꾀해서는 안됩니다. 재물이 스스로 융성해 질 것이니 이미 바람녘은 일은 더욱 성대하게 추진하십시오.','상하가 고르지 못하니 길흉이 상반입니다. 마음을 한 곳에 정하지 못하고 방황하고 있으니 실패하기 쉽습니다. 글쓴이의 운수는 이사하면 불리하니 집을 지키고 하던 일을 역심히 지켜이 이룹습니다. 위아래가 서로 합하도록 노력하십시오.','재산과 관력이 스스로 융성해집니다. 만약에 생산을 하지 않는다면 복을 입을 수입니다. 소와 나무는 불리하니 조심하십시오. 그러나 재산과 관력이 융성해 짐을 소홀히 말고 재수를 친손하게 받아들여야 합니다.','동방으로 나아가면 불리하고 제자리를 지키면 길하니 새것을 탐하지 말고 옛것을 지켜야 합니다. 사람을 잘 못 사귀면 반드시 해를 입칠 것이니 주의하십시오. 그러나 이익은 바로 사람을 사귀는 일에서 비롯되니 어찌 사람 사귀는 일을 소홀히 하겠습니까?','2025-03-02 11:57:26.742862+00','k');
